import React from 'react';
import './style.css';

const GiftList = props => {
    const Gifts = props.gifts.map(gift => {
        return (
            <div>
                <h1>{gift.name}</h1>
                <p>{gift.itemOne}</p>
                <p>{gift.itemTwo}</p>
                <p>{gift.itemThree}</p>
            </div>
        )
    })
    return Gifts
}

export default GiftList;
